import React from 'react';
import { Link } from 'react-router-dom';
import '../Css/Navbar.css';

export const Navbar = () => {
    return (
        <header>
            <ul className="navbar">
                <div className="link"><Link className="link" to="/">LOGO</Link></div>
                <div className="link"><Link to="/">Search</Link></div>
                <div className="link"><Link to="/mylist">myList</Link></div>
                <div className="link"><Link to="/watched">watched</Link></div>
            </ul>
        </header>
    )
}
